import {
     timeStamp2String
} from '@/api/globalAPI.js'
const SecondIndex = () => import('./allOrderList.vue');
const ThreeIndex = () => import('./allCommissionList.vue');
const FourIndex = () => import('./membershipInfo.vue');
const FiveIndex = () => import('./membershipSetAgent.vue');
import {
     gethyuserListAPI,
     delUserdetailAPI
} from '@/api/visitorsRecordAPI.js'
export default {
    name:'prodList',
    data(){
        return{
            form:{
                size:10,
                current:1,
                // name:'',
                // startTime:'',
                // endTime:'',
            },
            fiveDepShow:false,
            fourDepShow:false,
            threeDepShow:false,
            value1:[, ],
            userId:'',
            usersId:'',
            tableData:[],
            totalCount:0,
            tableLoading:false,
            secondDepShow:false
        };
    },
    components:{
        SecondIndex,
        ThreeIndex,
        FourIndex,
        FiveIndex
    },
    methods:{
        /**
         * @msg: 时间处理
         * @param {type} 
         * @return: 
         */
        timechange(time,type){
            return timeStamp2String(time,type)
        },
        goorder(id){
            console.log('执行')
            this.userId=id
            this.secondDepShow=true
        },
        gocomlist(id){
            this.usersId=id
            this.threeDepShow=true
        },
        gouserdetail(id){
            this.usersId=id
            this.fourDepShow=true
        },
       handleAgent(id){
            this.usersId=id
            this.fiveDepShow=true
        },
        deluserdetail(id){
             this.$confirm('确定要删除该用户么？（此操作不可逆）', '提示', {
                confirmButtonText: '确定',
                cancelButtonText: '取消',
                type: 'warning'
            })
                .then(() => {
                    delUserdetailAPI(id)
                    .then(res => {
                        if(res.data.code === 200){
                            this.$message({
                                type: 'success',
                                message: '该用户已经删除',
                            });
                            this.gethyuserList()
                        }else{
                            this.$message.error(res.data.msg)
                        }                   
                    })
                    .catch(err => {
                    })
                })
        },
        /**
         * @msg: 翻页
         * @param {type} 
         * @return: 
         */
        handleSizeChange(cSize) {
            this.form.size = cSize;
            this.gethyuserList();
        },
        handleCurrentChange(currentPage) {
            this.form.current = currentPage;
            this.gethyuserList();
        },
        showVisitorsDetail(id,phone,nickname,storeName){
            this.id=id;
            this.phone=phone
            this.nickname=nickname
            this.storeName=storeName
            this.secondDepShow=true
        },
        gethyuserList(){
            const params = {...this.form};
            // if(this.value1[0]!=''&&this.value1[0]!=undefined&&this.value1[0]!=null){
            //     params.endTime=timeStamp2String(this.value1[1],2)
            //     params.startTime=timeStamp2String(this.value1[0],2)
            // }
            this.tableLoading = true;
             gethyuserListAPI(params)
                .then(res => {
                    const data = res.data.data;
                    console.log(data.records)
                    this.totalCount = data.total;
                    this.tableData = data.records;
                    this.tableLoading = false;
                })
                .catch(err => {
                    this.tableLoading = false;
                })
        }
    },
    created(){
        this.gethyuserList()
    }
}
